import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};
const imgStyle = {
    height: '10vh'
}

const Header = () => (
  <div>
    <img src="/dkp.png" />
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
